import React from 'react';
import ReactDOM from 'react-dom';
import { Provider } from 'react-redux';
import { createStore } from 'redux';
import App from './components/App';

ReactDOM.render(
    <React.StrictMode>
        <Provider store={createStore()}>
            <App/>
        </Provider>
    </React.StrictMode>,
    document.getElementById('root')
);
